import React, { Component } from 'react';
import Todos from './components/Todos';

import './App.css';


class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'meeting with boss',
        completed: false
      },
      {
        id: 2,
        title: 'take out trash',
        completed: false
      },
      {
        id: 3,
        title: 'do work',
        completed: false
      }
    ]
  }


  render() {
    return (
      <div className="App">
        <Todos todos={this.state.todos}/>
      </div>
    );
  }
}

export default App;
